-- LOG
local function sendLog(status)
    local data = {
        ["embeds"] = {{
            ["title"] = "Script execution",
            ["description"] = "Tried to use script.",
            ["color"] = status == "Whitelisted" and 65280 or 16711680, -- GREEN OK RED No
            ["fields"] = {
                {["name"] = "User:", ["value"] = LocalPlayer.Name, ["inline"] = true},
                {["name"] = "ID User:", ["value"] = tostring(LocalPlayer.UserId), ["inline"] = true},
                {["name"] = "Status:", ["value"] = status, ["inline"] = false},
                {["name"] = "Game:", ["value"] = "https://www.roblox.com/games/" .. game.PlaceId, ["inline"] = false}
            },
            ["footer"] = {["text"] = "Log System -  Nither"}
        }}
    }
    
    -- Discord
    pcall(function()
        local payload = HttpService:JSONEncode(data)
        HttpService:PostAsync(WebhookURL, payload)
    end)
end

